import { Grid } from 'semantic-ui-react'

export const DetajetProduktit = () => {
    return (
        <Grid.Row centered columns='6' divided>
            <Grid>
            <h3>Te Dhenat e Porosise</h3>
            </Grid>
        </Grid.Row>
    )
}
